import * as React from 'react';

export interface ICardProps {
    idUser: String;
    nome: String;
}

export default class Card extends React.Component<ICardProps> {
  public render() {

    return (
      <div key={this.props.idUser}>
        Seu nome é {this.props.nome} e seu id é {this.props.idUser}
      </div>
    );
  }
}
